import react from 'react';
import ReactDOM from 'react-dom';
import {add,sub,mul,div} from './Calc';
function App() {
  return (
    <>
      <ul>
        <li>sum of given numbers is {add(3, 4)}</li>
        <li>sum of given numbers is {sub(3, 4)}</li>
        <li>sum of given numbers is {mul(3, 4)}</li>
        <li>sum of given numbers is {div(3, 4)}</li>
      </ul>
    </>

  )
}
export default App;
